import React from "react";
import "./Card.css";

const Card = (slide) => {
  return (
    <div className="slideContent">
      <img src={slide[0].img}></img>
      <div className="slideContentInner">
        <h1 className="slideTitle">{slide[0].title}</h1>
        <p className="slideDescription">{slide[0].description}</p>
      </div>
    </div>
  );
};
export default Card;
